			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
				shellScript = "GS_PATH=\"\"\nif [ -x /opt/homebrew/bin/gs ]; then\n  GS_PATH=\"/opt/homebrew/bin/gs\"\nelif [ -x /usr/local/bin/gs ]; then\n  GS_PATH=\"/usr/local/bin/gs\"\nfi\nif [ -z \"$GS_PATH\" ]; then\n  echo \"warning: Ghostscript (gs) not found; skipping bundle embed.\"\n  exit 0\nfi\nDEST_RES=\"${TARGET_BUILD_DIR}/${CONTENTS_FOLDER_PATH}/Resources\"\nDEST_FW=\"${TARGET_BUILD_DIR}/${CONTENTS_FOLDER_PATH}/Frameworks\"\nDEST_GS=\"$DEST_RES/gs\"\nTEMP_GS=\"${TARGET_TEMP_DIR}/gs\"\nmkdir -p \"$DEST_RES\" \"$DEST_FW\"\nif [ -e \"$DEST_GS\" ]; then\n  chmod u+w \"$DEST_GS\" 2>/dev/null || true\n  rm -f \"$DEST_GS\"\nfi\nif [ -e \"$TEMP_GS\" ]; then\n  chmod u+w \"$TEMP_GS\" 2>/dev/null || true\n  rm -f \"$TEMP_GS\"\nfi\nif cp \"$GS_PATH\" \"$TEMP_GS\"; then\n  chmod +x \"$TEMP_GS\" || true\nelse\n  echo \"warning: Failed to copy Ghostscript to temp.\"\n  exit 0\nfi\n/usr/bin/install_name_tool -add_rpath \"@executable_path/../Frameworks\" \"$TEMP_GS\" 2>/dev/null || true\nif cp \"$TEMP_GS\" \"$DEST_GS\"; then\n  chmod +x \"$DEST_GS\" || true\nelse\n  echo \"warning: Failed to copy Ghostscript into app bundle.\"\n  exit 0\nfi\nPREFIX=\"$(cd \"$(dirname \"$GS_PATH\")/..\" && pwd)\"\nGS_SHARE=\"$(cd \"$PREFIX/share/ghostscript\" && pwd -P)\"\nDEST_GS_LIB=\"$DEST_RES/ghostscript\"\nif [ -d \"$GS_SHARE\" ]; then\n  rm -rf \"$DEST_GS_LIB\"\n  mkdir -p \"$DEST_GS_LIB\"\n  for item in Resource lib iccprofiles fonts; do\n    if [ -e \"$GS_SHARE/$item\" ]; then\n      cp -R \"$GS_SHARE/$item\" \"$DEST_GS_LIB/\"\n    fi\n  done\nelse\n  echo \"warning: Ghostscript resources not found at $GS_SHARE\"\nfi\nQUEUE_FILE=\"${TARGET_TEMP_DIR}/gs_deps.txt\"\nPROCESSED_FILE=\"${TARGET_TEMP_DIR}/gs_deps_done.txt\"\n: > \"$QUEUE_FILE\"\n: > \"$PROCESSED_FILE\"\necho \"$DEST_GS\" >> \"$QUEUE_FILE\"\ni=1\nwhile true; do\n  item=$(sed -n \"${i}p\" \"$QUEUE_FILE\")\n  if [ -z \"$item\" ]; then\n    break\n  fi\n  i=$((i + 1))\n  if grep -Fxq \"$item\" \"$PROCESSED_FILE\"; then\n    continue\n  fi\n  echo \"$item\" >> \"$PROCESSED_FILE\"\n  deps=$(otool -L \"$item\" | tail -n +2 | awk '{print $1}')\n  for dep in $deps; do\n    case \"$dep\" in\n      /opt/homebrew/*|/usr/local/*)\n        resolved=\"$dep\"\n        ;;\n      @rpath/*)\n        base=$(basename \"$dep\")\n        resolved=$(find \"$PREFIX/opt\" -path \"*/lib/$base\" -print -quit 2>/dev/null)\n        if [ -z \"$resolved\" ] && [ -d /usr/local/opt ]; then\n          resolved=$(find /usr/local/opt -path \"*/lib/$base\" -print -quit 2>/dev/null)\n        fi\n        if [ -z \"$resolved\" ] && [ -f \"$PREFIX/lib/$base\" ]; then\n          resolved=\"$PREFIX/lib/$base\"\n        fi\n        ;;\n      *)\n        resolved=\"\"\n        ;;\n    esac\n    if [ -z \"$resolved\" ]; then\n      continue\n    fi\n    base=$(basename \"$resolved\")\n    dest=\"$DEST_FW/$base\"\n    if [ ! -e \"$dest\" ]; then\n      if cp \"$resolved\" \"$dest\"; then\n        chmod +x \"$dest\" || true\n        /usr/bin/install_name_tool -id \"@rpath/$base\" \"$dest\" 2>/dev/null || true\n        echo \"$dest\" >> \"$QUEUE_FILE\"\n      else\n        echo \"warning: Failed to copy $resolved\"\n        continue\n      fi\n    fi\n    /usr/bin/install_name_tool -change \"$dep\" \"@rpath/$base\" \"$item\" 2>/dev/null || true\n  done\ndone\nSIGN_ID=\"$EXPANDED_CODE_SIGN_IDENTITY\"\nif [ -n \"$SIGN_ID\" ]; then\n  /usr/bin/codesign --force --sign \"$SIGN_ID\" --timestamp=none \"$DEST_GS\" || true\n  for lib in \"$DEST_FW\"/*.dylib; do\n    if [ -f \"$lib\" ]; then\n      /usr/bin/codesign --force --sign \"$SIGN_ID\" --timestamp=none \"$lib\" || true\n    fi\n  done\nfi";
